import { createSlice } from '@reduxjs/toolkit';

const initialState = { isDeleteEnabled: true }

  const deleteSlice = createSlice({
    name: "delete",
    initialState: initialState,
    reducers: {
      enableDelete(state) {
        state.isDeleteEnabled = true
        
        console.log(state.storeData)
      },
      dissableDelete(state) {
        state.isDeleteEnabled = false
        
        console.log(state.storeData)
      }
    }
  
  })

  export const deleteActions = deleteSlice.actions

  export default deleteSlice.reducer
